          { title: 'Emphasis', value: 'em' },
          { title: 'Code', value: 'code' },
          {
            title: 'Highlight',
            value: 'highlight',
            blockEditor: {
              icon: highlightIcon,
              render: highlightRender,
            },
          },

          /*
          {
            title: 'Math',
            value: 'latex',
            blockEditor: {
              icon: latexIcon,
              render: latexRender
            }
          }
          */
        ],
        // Annotations can be any object structure – e.g. a link or a footnote.
        annotations: [
          {
            title: 'External link',
            name: 'externalLink',
            type: 'object',
            blockEditor: {
              icon: FaGlobe,
            },
            fields: [
              {
                title: 'URL',
                name: 'href',
                type: 'url',
              },
              {
                title: 'Open in new tab',
                name: 'blank',
                type: 'boolean',
              },
            ],
          },
          {
            title: 'Internal link',
            name: 'internalLink',
            type: 'object',
            blockEditor: {
              icon: FaPaperclip,
            },
            fields: [
              {
                title: 'Reference',
                name: 'reference',
                type: 'reference',
                to: [{ type: 'page' }],
              },
            ],
          },
          {
            title: 'Variables',
            name: 'variable',
            type: 'object',
            blockEditor: {
              icon: FaExchangeAlt,
            },
            fields: [
              {
                title: 'Reference',
                name: 'reference',
                type: 'reference',
                to: [{ type: 'gmb' }],
              },
            ],
          },
        ],
      },
      // of: [
      //   { type: 'authorReference' },
      //   { type: 'math', icon: mathInlineIcon, title: 'Inline math' },
      // ],
    },
    // You can add additional types here. Note that you can't use
    // primitive types such as 'string' and 'number' in the same array
    // as a block type.
    {
      type: 'imageAlt',
    },
    // { type: 'instagram' },
    // { type: 'videoEmbed' },
    // { type: 'math', icon: mathIcon, title: 'Math block' },
  ],
};

