import { FaListAlt as icon } from 'react-icons/fa';
import Tabs from 'sanity-plugin-tabs';

export default {
  title: 'Services',
  name: 'services',
  type: 'object',
  icon,
  inputComponent: Tabs,
  fieldsets: [
    { title: 'Layout', name: 'layoutSet' },
    { title: 'Headlines', name: 'headlinesSet' },
    { title: 'Services', name: 'servicesSet' },
  ],
  fields: [
    {
      title: 'Layout',
