      type: 'string',
      options: {
        list: [{ title: 'Images', value: 'images' }],
        layout: 'radio',
        direction: 'horizontal',
      },
      fieldset: 'layoutSet',
    },
    {
      title: 'Headline',
      name: 'headline',
      type: 'string',
      fieldset: 'headlinesSet',
    },
    {
      title: 'Tagline',
      name: 'tagline',
      type: 'string',
      fieldset: 'headlinesSet',
    },
    {
      title: 'Description',
      name: 'description',
      type: 'portableTextBody',
      fieldset: 'headlinesSet',
    },
    {
      title: 'Service',
      name: 'service',
      type: 'array',
      of: [{ type: 'service' }],
      fieldset: 'servicesSet',
    },
  ],
  preview: {
    select: {
      title: 'layout',
      media: 'icon',
    },
    prepare(selection) {
      const { title, media } = selection;
      return {
        title: `Services: ${title.charAt(0).toUpperCase() + title.slice(1)}`,
        media,
      };
    },
  },
};

