      title: 'Map Location',
      description: 'Select a GMB.',
      name: 'gmb',
      type: 'reference',
      to: [{ type: 'gmb' }],
      fieldset: 'mapSet',
    },
    {
      title: 'Tagline',
      description: 'Add a tagline below the logo.',
      name: 'tagline',
      type: 'string',
      fieldset: 'brandSet',
    },
    {
      title: 'Social Media Links',
      description: 'Add social links below the tagline.',
