      type: 'array',
      of: [
        {
          type: 'reference',
          to: [
            {
              type: 'social',
            },
          ],
        },
      ],
      fieldset: 'brandSet',
    },
    {
      title: 'Middle Columns',
      description: 'Add middle columns to the footer.',
      name: 'footerItem',
      type: 'array',
      of: [{ type: 'footerItem' }],
      fieldset: 'linksSet',
    },
  ],
};

