      fieldset: 'textSet',
    },
    {
      title: 'Tagline',
      name: 'tagline',
      type: 'string',
      hidden: ({ parent }) => !(parent?.layout === 'half'),
      fieldset: 'textSet',
    },
    {
      title: 'Description',
      name: 'description',
      type: 'portableTextBody',
      hidden: ({ parent }) => !(parent?.layout === 'half'),
      fieldset: 'textSet',
    },
    {
      title: 'CTA Button Label',
